summary: >-
  A class representing a collection of <xref data-throw-if-not-resolved="true" uid="Azure.ResourceManager.DataFactory.FactoryPrivateEndpointResource"></xref> and their operations.

  Each <xref data-throw-if-not-resolved="true" uid="Azure.ResourceManager.DataFactory.FactoryPrivateEndpointResource"></xref> in the collection will belong to the same instance of <xref data-throw-if-not-resolved="true" uid="Azure.ResourceManager.DataFactory.FactoryVirtualNetworkResource"></xref>.

  To get a <xref data-throw-if-not-resolved="true" uid="Azure.ResourceManager.DataFactory.FactoryPrivateEndpointCollection"></xref> instance call the GetFactoryPrivateEndpoints method from an instance of <xref data-throw-if-not-resolved="true" uid="Azure.ResourceManager.DataFactory.FactoryVirtualNetworkResource"></xref>.
